String servletPath = request.getServletPath();
String pathInfo = request.getPathInfo();
String forwardPage = servletPath.substring(1);
if ( pathInfo != null ) {
    forwardPage = forwardPage + pathInfo;
}
return forwardPage;

String pathInfo = request.getPathInfo();
if (pathInfo != null && pathInfo.length() > 1) {
    return "/" + pathInfo.substring(1);
} else {
    return null;
}

String pathInfo = request.getPathInfo();
if (pathInfo==null)
    pathInfo = "/";
return pathInfo;

String pathInfo = request.getPathInfo();
if (pathInfo == null)
    return "home";
else
    return pathInfo;

